---
apiVersion: bitnami.com/v1alpha1
kind: SealedSecret
metadata:
  name: secrets
  namespace: kube-system
spec:
  encryptedData:
    ACME_DNS_PASSWORD: 
    ACME_DNS_SUBDOMAIN: 
    ACME_DNS_USERNAME: 
    ADMIN_PASSWORD: 
    BITWARDEN_ADMIN_TOKEN: 
    CLOUDFLARE_API_EMAIL: 
    CLOUDFLARE_API_TOKEN: 
    CLOUDFLARE_ZONE_ID: 
    CLUSTER_DOMAIN_NAME: 
    CLUSTER_NAME: 
    CLUSTER_TIME_ZONE: 
    CONTROL_PLANE_IP: 
    CONTROL_PLANE_NAME: 
    EMAIL: 
    HEADLAMP_GOOGLE_CLIENT_ID: 
    HEADLAMP_GOOGLE_CLIENT_SECRET: 
    KUBECTX_NAME: 
    PAPERLESS_SECRET_KEY: 
    PAPRA_AUTH_SECRET: 
    SMTP_PASSWORD: 
    VPN_CITY: 
    VPN_PASSWORD: 
    VPN_USER: 
  template:
    metadata:
      annotations:
        reflector.v1.k8s.emberstack.com/reflection-allowed: "true"
        reflector.v1.k8s.emberstack.com/reflection-allowed-namespaces: default,monitoring
        reflector.v1.k8s.emberstack.com/reflection-auto-enabled: "true"
      name: secrets
      namespace: kube-system
